import './App.css';
import Header from'./View/Components/Header';
import Footer from './View/Components/Footer';
import RegistirationPage from './View/Pages/RegistirationPage';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Header/>
      </header>
      <div className="body-content">
        <p>Test0</p>
        <p>Test1</p>
        <p>Test2</p>
        <div className="container"> {/* Add container class here */}
          <RegistirationPage />
        </div>
      </div>

      <footer>
        <Footer/>
      </footer>
    </div>
  );
}
//test
export default App;
